import React from "react";

function Test() {
  //   const styles = {
  //     container: {
  //       backgroundColor: "#f0f0f0",
  //       padding: "20px",
  //       borderRadius: "8px",
  //       textAlign: "center",
  //     },
  //     heading: {
  //       color: "#333",
  //       fontSize: "24px",
  //     },
  //     button: {
  //       backgroundColor: "#007bff",
  //       color: "#fff",
  //       padding: "10px 20px",
  //       border: "none",
  //       borderRadius: "5px",
  //       cursor: "pointer",
  //     },
  //   };

  return (
    <div
      style={{
        width: 857,
        height: 550,
        position: "relative",
        background: "#17181A",
        borderRadius: 20,
        overflow: "hidden",
      }}
    >
      <div
        style={{
          width: 656,
          height: 63.39,
          left: 101,
          top: 56,
          position: "absolute",
          background: "#272829",
          borderRadius: 12,
          overflow: "hidden",
        }}
      >
        <div
          style={{
            width: 224.18,
            height: 23,
            left: 20,
            top: 20,
            position: "absolute",
            color: "rgba(255, 255, 255, 0.64)",
            fontSize: 18,
            fontFamily: "Outfit",
            fontWeight: "600",
            lineHeight: 23.4,
            wordWrap: "break-word",
          }}
        >
          Name
        </div>
      </div>
      <div
        style={{
          width: 656,
          height: 63.39,
          left: 101,
          top: 140,
          position: "absolute",
          background: "#272829",
          borderRadius: 12,
          overflow: "hidden",
        }}
      >
        <div
          style={{
            width: 224.18,
            height: 23,
            left: 20,
            top: 20,
            position: "absolute",
            color: "rgba(255, 255, 255, 0.64)",
            fontSize: 18,
            fontFamily: "Outfit",
            fontWeight: "600",
            lineHeight: 23.4,
            wordWrap: "break-word",
          }}
        >
          Email
        </div>
      </div>
      <div
        style={{
          width: 656,
          height: 205,
          left: 101,
          top: 224,
          position: "absolute",
          background: "#272829",
          borderRadius: 12,
          overflow: "hidden",
        }}
      >
        <div
          style={{
            width: 224.18,
            height: 23,
            left: 20,
            top: 20,
            position: "absolute",
            color: "rgba(255, 255, 255, 0.64)",
            fontSize: 18,
            fontFamily: "Outfit",
            fontWeight: "600",
            lineHeight: 23.4,
            wordWrap: "break-word",
          }}
        >
          Message
        </div>
      </div>
      <div
        style={{
          width: 656,
          height: 44,
          left: 101,
          top: 450,
          position: "absolute",
          background: "#914BF1",
          borderRadius: 8,
          overflow: "hidden",
        }}
      >
        <div
          style={{
            width: 180,
            height: 24,
            left: 238,
            top: 10,
            position: "absolute",
          }}
        >
          <div
            style={{
              width: 57.32,
              height: 16.8,
              left: 61.52,
              top: -17,
              position: "absolute",
              color: "white",
              fontSize: 14,
              fontFamily: "Outfit",
              fontWeight: "500",
              lineHeight: 16.8,
              wordWrap: "break-word",
            }}
          >
            Let's Talk
          </div>
          <div
            style={{
              width: 57.32,
              height: 16.8,
              left: 72,
              top: 4,
              position: "absolute",
              color: "white",
              fontSize: 14,
              fontFamily: "Outfit",
              fontWeight: "500",
              lineHeight: 16.8,
              wordWrap: "break-word",
            }}
          >
            Send
          </div>
        </div>
      </div>
      <div
        data-svg-wrapper
        style={{ left: 807, top: 20, position: "absolute" }}
      >
        <svg
          width="24"
          height="24"
          viewBox="0 0 24 24"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
        >
          <path
            d="M18.36 19.78L12 13.41L5.63997 19.78L4.21997 18.36L10.59 12L4.21997 5.63997L5.63997 4.21997L12 10.59L18.36 4.22997L19.77 5.63997L13.41 12L19.77 18.36L18.36 19.78Z"
            fill="white"
          />
        </svg>
      </div>
    </div>
  );
}
export default Test;
